The Fringe represents the rest of the Galaxy that doesn't fall within the bounds of either the Galactic Empire or the Rebel Alliance. The majority of them are innocent bystanders in the events, their numbers made up of mostly farmers, civilians and traders. However, the Fringe also represents the small number of mercenaries and bounty hunters as well, often having their services hired to either one of the two factions vying for control. While the massive population and large amounts of planets that fall under this category are mostly unorganized and unaffiliated with large military forces, they are still not easily pushed around.

Notable members of the Fringe are;
Boba Fett, Jabba the Hutt.

The Galactic Empire, (also known as the New Order, the Old Galactic Empire, the First Galactic Empire, Palpatine's New Order, or simply the Empire,) is the galactic government established by Supreme Chancellor Palpatine to replace the Galactic Republic in 19 BBY and bring Sith rule to the galaxy. The Republic, which has lasted intermittently for almost 25,000 years, ended following a period of intense political turmoil and the devastation of the Clone Wars. After General Grievous was defeated at the Battle of Utapau, and shortly after the leaders of the Confederacy of Independent Systems were killed on Mustafar by Darth Vader, Palpatine began a purge of the Jedi Order, declared himself Emperor of the galaxy and reorganized the Galactic Republic into the first Galactic Empire.

Notable members of the Galactic Empire are;
Emperor Palpatine, Darth Vader.

The Alliance to Restore the Republic (also known as the Rebel Alliance and, informally, as the Rebellion), is a loose alliance of planetary-, system-, and sector-level resistance forces formed in direct military opposition to the Galactic Empire. It was originally formed by a group of Loyalists determined to preserve the ideals of the Galactic Republic, but eventually grew to include former Separatists, defecting Imperials, and once-neutral systems. Although it has fewer troops and resources when compared to the Imperial Military, the Alliance possesses a strong will to fight, dedicated soldiers, and brilliant commanders.

Notable members of the Rebel Alliance are;
Mon Mothma, Admiral Ackbar, Luke Skywalker, Han Solo, Chewbacca, Lando Calrissian.
